import React from 'react';
import { useAuth } from '../auth/AuthContext';

function UserList() {
  const { users } = useAuth();

  return (
    <div className="user-list">
      <h2>Usuarios Registrados</h2>
      <table>
        <thead>
          <tr>
            <th>Nombre</th>
            <th>Usuario</th>
            <th>Rol</th>
            <th>Ãšltimo Login</th>
          </tr>
        </thead>
        <tbody>
          {users.map(user => (
            <tr key={user.username}>
              <td>{user.name}</td>
              <td>{user.username}</td>
              <td>{user.role}</td>
              <td>
                {user.lastLogin ? 
                  new Date(user.lastLogin).toLocaleString() : 
                  'Nunca'}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default UserList;
